import './App.css';

function App() {
  return (
    <div>
    <div className="App-Header">
    </div>
    <div className="App-Body">
      <body>
        BODY
      </body>
      </div>
      <div className="App-Footer">
      <footer>
        FOOTER
      </footer>
      </div>
    </div>
  );
}

export default App;
